import React, { useState } from "react";
import { Box, Grid } from "@material-ui/core";
import Caption from "../../Typography/Caption";
import Title from "../../Typography/Title";
import FeaturedWork from "./FeaturedWork";

function OurWorks() {
  const [featured] = useState([
    {
      title: "KEMIS YELEBESKU LET",
      image: "assets/kemis-yelebesku.png",
      type: "Feature Film",
    },
    {
      title: "TEDDY AFRO - MAR ESKE TUAF",
      image: "assets/teddy-afro.png",
      type: "Music Video",
    },
    {
      title: "EWUR AMORA KELABI",
      image: "assets/ewuramora.png",
      type: "Documentary",
    },
    {
      title: "JAON BEER",
      image: "assets/jano.png",
      type: "Advertising",
    },
  ]);
  const [infosCount] = useState([
    { count: 100, title: "BRAND VIDEOS" },
    { count: 50, title: "CREATIVE CONTENT" },
    { count: 30, title: "HAPPY USERS" },
    { count: 5, title: "AWARDS WON" },
  ]);
  return (
    <Grid container direction="column" alignItems="center" spacing={3}>
      <Grid item>
        <Caption>Our Works </Caption>
      </Grid>
      <Grid item>
        <Title>FEATURED WORKS</Title>
      </Grid>
      <Grid container item>
        {featured.map((f, key) => (
          <Grid key={key} item xs={12} sm={12} md={6}>
            <FeaturedWork {...f} />
          </Grid>
        ))}
      </Grid>
      <Box height={40} />
      <Grid container item>
        {infosCount.map((item, key) => (
          <Grid
            key={key}
            container
            item
            xs={12}
            sm={6}
            md={3}
            direction="column"
            alignItems="center"
            spacing={1}
          >
            <Grid item>
              <Title>{item.count}+</Title>
            </Grid>
            <Grid item>
              <Title sm>{item.title}</Title>
            </Grid>
            <Box height="20px" />
          </Grid>
        ))}
      </Grid>
    </Grid>
  );
}

export default OurWorks;
